UPDATE AD_FIELD SET AD_CLIENT_ID=0,AD_ORG_ID=0,ISACTIVE='Y',CREATEDBY=0,UPDATEDBY=0,NAME='Document No',DESCRIPTION='Document sequence number of the document',HELP='The document number is usually automatically generated by the system and determined by the document type of the document. If the document is not saved, the preliminary number is displayed in "<>".  If the document type of your document has no automatic document sequence defined, the field is empty if you create a new document. This is for documents which usually have an external number (like vendor invoice).  If you leave the field empty, the system will generate a document number for you. The document sequence used for this fallback number is defined in the "Maintain Sequence" window with the name "DocumentNo_<TableName>", where TableName is the actual name of the table (e.g. C_Order).',ISCENTRALLYMAINTAINED='Y',AD_TAB_ID=641,AD_COLUMN_ID=11470,AD_FIELDGROUP_ID=null,ISDISPLAYED='Y',DISPLAYLOGIC=null,DISPLAYLENGTH=20,ISREADONLY='N',SEQNO=30,SORTNO=-1,ISSAMELINE='N',ISHEADING='N',ISFIELDONLY='N',ISENCRYPTED='N',ENTITYTYPE='D',OBSCURETYPE=null WHERE AD_FIELD_ID=10019;
