UPDATE AD_FIELD SET AD_CLIENT_ID=0,AD_ORG_ID=0,ISACTIVE='Y',CREATEDBY=0,UPDATEDBY=0,NAME='Document Value Logic',DESCRIPTION='Logic to determine Workflow Start - If true, a workflow process is started for the document',HELP='You can enter simple logic using variables like @Created@=@Updated@, which fires, when a record is created. If you need to evaluate also values of other records, you need to use SQL logic and need to prefix this logic with "SQL=". Example: start a Order verify workflow, when a business partner ordered something and is over the credit limit  "SQL=EXISTS (SELECT * FROM C_BPartner bp WHERE C_Order. C_BPartner_ID=bp. C_BPartner_ID AND SO_CreditUsed > SO_CreditLimit)". Note that the SQL based logic checks for duplicate workflows (i.e. a workflow is started only once per record).',ISCENTRALLYMAINTAINED='Y',AD_TAB_ID=148,AD_COLUMN_ID=12923,AD_FIELDGROUP_ID=null,ISDISPLAYED='Y',DISPLAYLOGIC='@WorkflowType@=V',DISPLAYLENGTH=60,ISREADONLY='N',SEQNO=110,SORTNO=null,ISSAMELINE='N',ISHEADING='N',ISFIELDONLY='N',ISENCRYPTED='N',ENTITYTYPE='D',OBSCURETYPE=null WHERE AD_FIELD_ID=10900;
